import React, { useEffect } from "react";
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Container,
} from "@mui/material";
import { useAuthContext } from '../../hooks/useAuthContext';

const OwnerHome = () => {
  const { user } = useAuthContext();
  const houseId = JSON.parse(localStorage.getItem("User"));
  useEffect(() => {
    fetch(`http://localhost:4000/getBook/${houseId.Email}`,{
      headers:{
        "Authorization" : `Bearer ${user.token}`
      }
    });
  },[]);

  const backgroundStyle = {
    background: "linear-gradient(135deg, #FFD700, #FF5733, #6AFB92)",
    padding: "20px",
    minHeight: "100vh",
    opacity:"0.6"
  };

  return (
    <div style={backgroundStyle}>
      <Container maxWidth="lg">
        <TableContainer component={Paper}>
          <Table
            style={{
              minWidth: 650,
            }}
          >
            <TableHead>
              <TableRow>
                <TableCell
                  style={{
                    fontWeight: "bold",
                  }}
                >
                  Header 1
                </TableCell>
                <TableCell
                  align="right"
                  style={{
                    fontWeight: "bold",
                  }}
                >
                  Header 2
                </TableCell>
                <TableCell
                  align="right"
                  style={{
                    fontWeight: "bold",
                  }}
                >
                  Header 3
                </TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              <TableRow>
                <TableCell>Row 1, Cell 1</TableCell>
                <TableCell align="right">Row 1, Cell 2</TableCell>
                <TableCell align="right">Row 1, Cell 3</TableCell>
              </TableRow>
              <TableRow>
                <TableCell>Row 2, Cell 1</TableCell>
                <TableCell align="right">Row 2, Cell 2</TableCell>
                <TableCell align="right">Row 2, Cell 3</TableCell>
              </TableRow>
              {/* Add more rows as needed */}
            </TableBody>
          </Table>
        </TableContainer>
      </Container>
    </div>
  );
};

export default OwnerHome;
